{"version":"KqlItem/1.0","query":"// Virtual Machine free disk space
// Show the latest report of free disk space, per instance
InsightsMetrics
| where Name == "FreeSpacePercentage"
| summarize arg_max(TimeGenerated, *) by Computer
// arg_max over TimeGenerated returns the latest record
| project Val, Computer, Tags
| render barchart ","size":0,"title":"Disk free space percentage","timeContext":{"durationMs":86400000},"queryType":0,"resourceType":"microsoft.operationalinsights/workspaces","crossComponentResources":["/subscriptions/690b46a6-3499-4e6a-8f5c-8bff2dd422a7/resourceGroups/DefaultResourceGroup-CUS/providers/Microsoft.OperationalInsights/workspaces/DefaultWorkspace-690b46a6-3499-4e6a-8f5c-8bff2dd422a7-CUS","/subscriptions/690b46a6-3499-4e6a-8f5c-8bff2dd422a7/resourceGroups/rg1-resources/providers/Microsoft.OperationalInsights/workspaces/acctest-01"]}

